import{_ as e,c as o,o as s,b as t}from"./app.5b22e94d.js";const N=JSON.parse('{"title":"十一月一日","description":"","frontmatter":{"title":"十一月一日","date":"2020-11-01T00:00:00.000Z","draft":false,"tags":[2020]},"headers":[],"relativePath":"note/2020/20201101.md"}'),n={name:"note/2020/20201101.md"},_=t("p",null,"昨天苏宁输了，就在九点过，这似乎是早就预料到的一样，所以我没有多难受，只是觉得游戏好像也就那么一回事，把手机上游戏全都卸载了，然后早早的睡去了，十点过，是我最近睡得最早的一次，就空空如也，睡了过去。",-1),l=t("p",null,"醒来的时候，屋子里一个人都没有，我还是被闹钟叫醒的，七点过，今天不上班，我偏过头又睡去了，",-1),a=t("p",null,"知道九点过十点的样子，我才醒过来，翻了一圈手机，发现是如此无聊，居然没有什么值得去注意的东西。",-1),c=t("p",null,"起床洗漱，把客厅收拾了一下，一看快递也快到了，打开电脑，看了一会代码，想着一会取快递的时候，顺便吃个午饭，午饭就可以这么便捷的解决掉了。",-1),d=t("p",null,"果然也是，中午还是那家 川菜店，一个盖饭，一个干啤，刚刚饱，回来的时候，天气很好，很暖和，小区里挺热闹的，小朋友踏着小车追逐，大人们也出来了，聊天散步，看起来很休闲，我从旁边走过，知道这些于我无关，于是我转身上了楼。 趁着状态不错的时候，我准备好好读一份源码，然后写一个搜索引擎，前段时间粗略读了一本书，所以我就想把自己的知识板块在扩充一下，爬虫我现在是很有自信的，一些基础的爬虫，几乎没有压力。但是要产生应用价值，对我而言还是很难的，我不知道怎么用拿回来的数据产生价值，那我只能归咎于能力不够吧，不能随心所欲的使用数据，这一方面需要得到加强。",-1),i=t("p",null,"下午的状态还不错，看了几个小时源码，也尝试自己写了一点，但还是有些问题，不能按照既定想法写出代码，所以还是有很多我不能预知的问题，阻塞着我，让我有点难以前进。",-1),p=t("p",null,"现在是天快黑了，我把客厅的窗帘拉起来，就可以看到一天外面的光线变化，屋内的物体轮廓越模糊，说明天色越暗。",-1),r=t("p",null,"所以今天似乎是很平淡的一天，因为并没有发生什么意料之外的事情，也没有什么惊喜，没什么值得悲伤的。",-1),u=t("p",null,"我想起来要写写日记，也是在刚才，我决定把电脑搬到床上，我觉得需要一个间隙的休息，让大脑得到放松，现在也差不多了，我该止住。",-1),h=[_,l,a,c,d,i,p,r,u];function f(m,$,x,B,g,k){return s(),o("div",null,h)}const b=e(n,[["render",f]]);export{N as __pageData,b as default};
